import React,{useEffect} from 'react';
import {Tab, Tabs} from '@mui/material';
import { ReactComponent as PartTimerBanner } from '../../assets/images/subscriptionBg1.svg';
import ActiveJobsTab from './my-jobs-tabs/active-jobs';
import UpcommingJobsTab from './my-jobs-tabs/upcoming-jobs';
import AppliedJobsTab from './my-jobs-tabs/applied-jobs';
import CompletedJobTab from './my-jobs-tabs/completed-jobs';

import PositionFilledTab from './my-jobs-tabs/position-filled';
import { EmployeeTabData } from '../../sevices/account'

import './part-timer-style.scss'
function MyJobsComponent() {
    const [selectedTab, setSelectedTab] = React.useState(0);
    const [activeTab, setActiveTab] = React.useState(0);
    const [upcommingTab, setUpcommingTab] = React.useState(0);
    const [appliedTab, setAppliedTab] = React.useState(0);
    const [completedTab, setCompletedTab] = React.useState(0);
    const [positionFilledTab, setPositionFilledTab] = React.useState(0);
    const queryParams = new URLSearchParams(window.location.search);
    const tabKey = queryParams.get('key');
    useEffect(() => {

        ActiveData();
        AppliedData();
        CompletedData();
        UpcomingData();
        RejectedData();
      }, []);
      useEffect(() => {

        if(tabKey){
          const keyValue = parseInt(tabKey)
          if (keyValue===2) {
            setSelectedTab(0)
          }else(
            setSelectedTab(keyValue)
          )
         }

        }, [tabKey]);
    const ActiveData = async () => {
        // setLoading(true);
        let requestParams = {status:[5]};

        try {
          const response = await EmployeeTabData(requestParams);
          if(response?.status === 200) {
            setActiveTab(response?.data?.meta?.total)
          }
        }catch(err) {
          console.log("ERRR",err)
        }
    //     finally {
    //   setLoading(false);
    //   }    
      };
      const AppliedData = async () => {
        let requestParams = {status:[4]};
        try {
          const response = await EmployeeTabData(requestParams);
          if(response?.status === 200) {
            setAppliedTab(response?.data?.meta?.total)
          }
        }catch(err) {
          console.log("ERRR",err)
        }
      };
      const CompletedData = async () => {
        let requestParams = {status:[9]};
        try {
          const response = await EmployeeTabData(requestParams);
          if(response?.status === 200) {
            setCompletedTab(response?.data?.meta?.total)
          }
        }catch(err) {
          console.log("ERRR",err)
        }
      };
      const UpcomingData = async () => {
        let requestParams = {status:[5]};
        try {
          const response = await EmployeeTabData(requestParams);
          if(response?.status === 200) {
            setUpcommingTab(response?.data?.meta?.total)

          }
        }catch(err) {
          console.log("ERRR",err)
        }
      };
      const RejectedData = async () => {
        let requestParams = {status:[6]};
        try {
          const response = await EmployeeTabData(requestParams);
          if(response?.status === 200) {
            setPositionFilledTab(response?.data?.meta?.total)
          }
        }catch(err) {
          console.log("ERRR",err)
        }
      };
  const handleTabChange = (event, newValue) => {
    setSelectedTab(newValue);
  };
    return (
        <div className="myJobsPage">
            <div className="mainTitle">
                My Jobs
            </div>
            <div className="myJobsTabContainer">
                <Tabs value={selectedTab} onChange={handleTabChange} TabIndicatorProps={{ sx: { display: 'none' } }}
          sx={{
            '& .MuiTabs-flexContainer': {
              flexWrap: 'wrap',
            },
          }}>
                    {/* <Tab label={`Active jobs (${activeTab ? activeTab: '0'})`} /> */}
                    <Tab label={`Upcoming jobs (${upcommingTab ? upcommingTab: '0'})`} />
                    <Tab label={`Applied jobs (${appliedTab ? appliedTab: '0'})`}/>
                    <Tab label={`Completed jobs (${completedTab ? completedTab: '0'})`}/>
                    <Tab label={`Position filled (${positionFilledTab ? positionFilledTab: '0'})`} />
                </Tabs>
                {/* {selectedTab === 0 && (
                    <ActiveJobsTab/>
                )} */}
                {selectedTab === 0 && (
                    <UpcommingJobsTab/>
                )}
                {selectedTab === 1 && (
                    <AppliedJobsTab/>
                )}
                  {selectedTab === 2 && (
                    <CompletedJobTab/>
                )}
                {selectedTab === 3 && (
                    <PositionFilledTab/>
                )}
            </div>
        </div>
    )
}
export default MyJobsComponent;
